const data = {
    ballData: {
        x: 20,
        y: 200,
        dx: 5,
        dy: 5,
        rad: 10,
        speed: 10,
    },
    brickData: {
        x: 0.5,
        y: 50,
        height: 20,
        density: 2,
        colors: ["red", "lime"],
    },
    playerData: {
        name: "Breakout!",
        link: "https://github.com/safwbdev/breakout-react",
        lives: 3,
        score: 0,
        level: 1,
    },
    racquetData: {
        height: 20,
        width: 150,
        x: 100,
        y: 0,
    },
};
export default data
